"use strict";

// Initialize gViz global namespace
if (!window.gViz) {
  window.gViz = {};
}

// Create visualizations objects
if (!window.gViz.vis) {
  window.gViz.vis = {};
}

// Create initializers objects
if (!window.gViz.initializers) {
  window.gViz.initializers = {};
}

// Create shared objects
if (!window.gViz.shared) {
  window.gViz.shared = {};
}
